import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

import FunkRecords from "../../assets/test.png"

const Banner = ({}: Props) => {
  return (
     <Styled.MainBanner> 
      <Styled.Description fontSize={[20, 24, 32]} 
        backgroundImage={[`url(${FunkRecords})`, `url(${FunkRecords})`, `url(${FunkRecords})`]}>
          Já pensou?! Ter acesso a músicas e videoclipes 
          exclusivos do: MC Luan da BS, MC L Da Vinte,
          MC Kaio e cia.?
        </Styled.Description>
     </Styled.MainBanner>
  ) 
};

export default Banner;
